유쾌한 그녀들과 함께 선아선생님 생일겸 연말 모임
줌바옷 벗고...
모이기 시직할때부터 웃음으로 시작해서 끝날때까지 웃음이 끝이지 않는모임....
홍대에서 헤매는 여자들....
넘 즐거운 모임... #우루사 #웃음천사들 #쎈언니모임
#홍대뉴욕스테이크 #생일 #연말모임

