올해 마지막 서울 강모 연말파티를 했습니다. 너무 재미나고 선생님들 티칭 너무 재미 있었고요
오랜만에 진네이션에가서 다들 얼굴  보니 즐거웠습니다.
서울팀 선생님들 모두 음식들 준비해 주시느라 고생하시고 .... 올해는 음식도 아주많아서 더 많이들 드셨습니다한해 마무리 잘들 하시고 새해에도 건강하게 줌바 하실수 있기를 빌어요

